{
  (mkTestBench_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkTestBench::dump_VCD(tVCDDumpType dt)
{
  (mkTestBench_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkTestBench_backing(sim_hdl));
}
